import React from 'react'

  export default function ContactForm() {
    return(
      <>
        <form name="interesse"  action="?=sucess" method="POST" data-netlify="true">
        <input type="hidden" name="interesse" value="interesse" />
        <p>
          <label>Navn:</label>  
          <input type="text" name="name" data-netlify="true" placeholder="Jahn "/> 
        </p>
        <p>
          <label>Epost:</label>
          <input type="email" name="email" data-netlify="true" placeholder="dittnavn@eksempel.no"/>
        </p>
        <p>
        <label>Leie fra:</label>
        <input type="date" name="utleiestart"/>
        </p>

        <p>
        <label>Leie til</label>
        <input type="date" name="utleiestart"/>
        </p>

        <p>
          <label>Merknader:</label> 
          <textarea type="textarea" name="text" data-netlify="true">
          </textarea>
        </p>

        <button type="submit">Send foresp√∏rsel</button>

      </form>

      <style jsx>{`    
          button{
            background: #2d2d2d;
            outline: none;
            border-radius: 3px;
            width: 100%;
            padding: .5rem;
            margin: 0 auto;
            color: #fff;
            border: none;
            text-transform: uppercase;
            font-style: italic;
          }


          input{
            border-radius: 3px;
            width: 100%;
            padding: .5rem;
            color: #2d2d2d;
            margin: .2rem 0rem;
            outline: none;
            border: none;
          }

          input:textarea{
            height: 200px;
          }
        `}</style>
      </>
    )  

  }
